import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

const span = React.createElement('span', {}, 'im span')

const element = React.createElement('h1', {
  className: 'myClass',
}, span)



const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(element);
